import React, { useState } from 'react';
import '../styles/Contact.css';

const Contact = () => {
  // Form state
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    phone: '',
    subject: '',
    message: '',
    service: ''
  });

  // Form submission state
  const [isSubmitting, setIsSubmitting] = useState(false);
  const [submitSuccess, setSubmitSuccess] = useState(false);
  const [submitError, setSubmitError] = useState(false);
  const [errorMessage, setErrorMessage] = useState('');

  // Handle input changes
  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prevState => ({
      ...prevState,
      [name]: value
    }));

    // Clear previous error when user starts typing
    if (submitError) {
      setSubmitError(false);
      setErrorMessage('');
    }
  };

  // Handle form submission
  const handleSubmit = async (e) => {
    e.preventDefault();
    setIsSubmitting(true);
    setSubmitError(false);
    setSubmitSuccess(false);

    try {
      // Validate required fields
      const { name, email, subject, message, service } = formData;
      if (!name || !email || !subject || !message || !service) {
        throw new Error('Please fill in all required fields');
      }

      // Log the data being sent
      console.log('Sending form data:', formData);

      const response = await fetch('http://localhost:8000/api/messages', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(formData),
      });

      // Log the response
      console.log('Response status:', response.status);

      const data = await response.json();
      console.log('Response data:', data);

      if (response.ok) {
        setSubmitSuccess(true);

        // Reset form after successful submission
        setFormData({
          name: '',
          email: '',
          phone: '',
          subject: '',
          message: '',
          service: ''
        });

        // Hide success message after 5 seconds
        setTimeout(() => {
          setSubmitSuccess(false);
        }, 5000);
      } else {
        // Handle server-returned error
        setSubmitError(true);
        setErrorMessage(data.message || 'An unexpected error occurred');
        console.error('Form submission error:', data.message);
      }
    } catch (error) {
      // Handle network or validation errors
      setSubmitError(true);
      setErrorMessage(error.message || 'Something went wrong. Please try again.');
      console.error('Detailed form submission error:', error);
    } finally {
      setIsSubmitting(false);
    }
  };

  return (
    <div className="contact-page">
      {/* Existing sections remain unchanged */}

      <section className="main-contact-section">
        <div className="container">
          <div className="contact-grid">
            <div className="contact-form-wrapper">
              <div className="form-card">
                <h2>Send Us a Message</h2>

                {submitSuccess && (
                  <div className="success-message">
                    <svg xmlns="http://www.w3.org/2000/svg" className="check-icon" viewBox="0 0 20 20" fill="currentColor">
                      <path fillRule="evenodd" d="M10 18a8 8 0 100-16 8 8 0 000 16zm3.707-9.293a1 1 0 00-1.414-1.414L9 10.586 7.707 9.293a1 1 0 00-1.414 1.414l2 2a1 1 0 001.414 0l4-4z" clipRule="evenodd" />
                    </svg>
                    <p>Thank you! Your message has been sent successfully.</p>
                  </div>
                )}

                {submitError && (
                  <div className="error-message">
                    <svg xmlns="http://www.w3.org/2000/svg" className="error-icon" viewBox="0 0 20 20" fill="currentColor">
                      <path fillRule="evenodd" d="M10 18a8 8 0 100-16 8 8 0 000 16zM8.707 7.293a1 1 0 00-1.414 1.414L8.586 10l-1.293 1.293a1 1 0 101.414 1.414L10 11.414l1.293 1.293a1 1 0 001.414-1.414L11.414 10l1.293-1.293a1 1 0 00-1.414-1.414L10 8.586 8.707 7.293z" clipRule="evenodd" />
                    </svg>
                    <p>{errorMessage || 'Oops! Something went wrong. Please try again.'}</p>
                  </div>
                )}

                <form className="contact-form" onSubmit={handleSubmit}>
                  {/* Form inputs remain the same */}
                  <button 
                    type="submit" 
                    className={`submit-button ${isSubmitting ? 'submitting' : ''}`}
                    disabled={isSubmitting}
                  >
                    {isSubmitting ? (
                      <>
                        <span className="spinner"></span>
                        Sending Message...
                      </>
                    ) : 'Send Message'}
                  </button>
                </form>
              </div>
            </div>
          </div>
        </div>
      </section>
      {/* Map Section */}
      <section className="map-section">
        <div className="container">
          <div className="map-wrapper">
            <iframe
              src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3153.9185565277915!2d-122.4000805!3d37.7808078!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x80858085ced962db%3A0x2b904b63c587f8eb!2sSan%20Francisco%2C%20CA%2094107!5e0!3m2!1sen!2sus!4v1616179531151!5m2!1sen!2sus"
              title="Office Location"
              frameBorder="0"
              allowFullScreen=""
              loading="lazy"
            ></iframe>
          </div>

          <div className="location-card">
            <h3>Our Office</h3>
            <p className="address">
              <svg xmlns="http://www.w3.org/2000/svg" className="location-pin" viewBox="0 0 20 20" fill="currentColor">
                <path fillRule="evenodd" d="M5.05 4.05a7 7 0 119.9 9.9L10 18.9l-4.95-4.95a7 7 0 010-9.9zM10 11a2 2 0 100-4 2 2 0 000 4z" clipRule="evenodd" />
              </svg>
              123 Tech Street, San Francisco, CA 94107
            </p>
            <div className="office-hours">
              <h4>Hours of Operation</h4>
              <p>Monday - Friday: 9:00 AM - 6:00 PM</p>
              <p>Saturday - Sunday: Closed</p>
            </div>
            <a href="https://goo.gl/maps/examplelink" className="directions-button" target="_blank" rel="noopener noreferrer">
              Get Directions
            </a>
          </div>
        </div>
      </section>

      {/* FAQ Section */}
      <section className="faq-section">
        <div className="container">
          <div className="section-header">
            <h2>Frequently Asked <span className="gradient-text">Questions</span></h2>
            <p>Find answers to common questions about working with us</p>
          </div>

          <div className="faq-grid">
